import './MemoryCard.css'

export const MemoryCards = ({ card, handleChoice, flipped }) => {

  const handleClick = () => {
    console.log('cj')
    handleChoice(card);
  }

  return (
    <div className='card'>
      <div></div>
      <img className='front' src={card.src} alt='card front' />
      <img
        className='back'
        src={bird}
        alt='card back'
        onClick={handleClick}
      />
    </div>
  )
}
